import React, { useState } from 'react';
import './MembershipPage.css'; // Import CSS for styling

const MembershipPage = () => {
  const [selectedMembership, setSelectedMembership] = useState(null);

  const handleMembershipSelect = (membershipType) => {
    setSelectedMembership(membershipType);
    // Console log the selected membership type here to send it to the backend
    console.log(`Selected Membership: ${membershipType}`);
  };

  return (
    <div className="membership-page">
      <h2>Choose Your Membership</h2>
      <div className="membership-buttons">
        <button onClick={() => handleMembershipSelect('Standard')}>Standard Membership</button>
        <button onClick={() => handleMembershipSelect('Elite')}>Elite Membership</button>
        <button onClick={() => handleMembershipSelect('Premium')}>Premium Membership</button>
      </div>
    </div>
  );
};

export default MembershipPage;
